import React from 'react';
import { ListGroup, ListGroupItem, Jumbotron, Container, Table } from 'reactstrap';
import './displayLink.css'


function DisplayLink(props) {

   return (
       <Container>
       <Jumbotron fluid className="">
        <Container fluid>
          <h1 className="display-3">Links for Sharing</h1>
        </Container>
      </Jumbotron>
      <Table>
        <thead>
        <tr>
        <th>#</th>
        <th>URL</th>
        </tr>
        </thead>
        <tbody>

        { props.link.map((data, index) => {
           return (

          <div>
        <tr>     
          <th scope="row">{index + 1}</th>
          <td><a key={index} href={data.url}>{data.url}</a></td>
          </tr>
          </div>
          )
        })}

        </tbody>
       </Table>
       </Container>
    )
}

export default DisplayLink;
